p.push( '--retry', '0' );
p.push( '-k' );
p.push( '--proxy' );
if (msg.url.startsWith("https://")) {
    p.push( 'http://205.167.7.126:443')
} else {
    p.push( 'http://205.167.7.126:80')
}
//p.push( '-X', "'" + msg.method + "'");
for (var k in msg.headers ) {
    p.push( "-H", "'" + k + ": " + msg.headers[k] + "'" );
}
p.push( msg.url );
var v = JSON.stringify( msg.payload );
p.push( '-d', v );
msg.payload=p.join(" ");
return msg;

const tag = "data_model";
const incoming = { payload: msg.payload };
const base = parseInt( msg.baseRegister );
const model = global.get( tag );
const nb_digits = 4;

var getName = (function() {
    var defaultformat = function( i ) {
        var bi = base + i;
        var str = bi.toString(16);
        str = '0x' + '0'.repeat( nb_digits - str.length ) + str;
        return str;
    }
    if (model === undefined) {
        return defaultformat;
    } else {
        return function ( i ) {
            var bi = base + i;
            if ( bi in model ) {
                return model[ base + i ];
            } else {
                return defaultformat( i );
            }
        }
    }
})();

msg.payload = msg.payload.reduce((acc, v) => {
    acc[getName( acc.i++ )] = v;
    if (acc.i == acc.end) {
        delete acc.i;
        delete acc.end;
    }
    return acc;
}, { i: 0, end: msg.payload.length });


return msg;

const tag = "data_model";
if (!Array.isArray(msg.payload) || msg.payload.length === 0) {
    msg.topic = "reset";
}

switch (msg.topic) {
    case "reset":
        global.set( tag, undefined);
        break;
    default:
        var model={};
        msg.payload.forEach((l) => {
            l.addr = parseInt( l.addr );
            model[l.addr]=l.name;
        })
        global.set( tag, model );
        break;
}

return { 'topic': "new data_model", 'model': global.get( tag )};

